246	tt2991224	/title/tt2991224	Mandariinid	War in Georgia, Abkhazia region 1992: local Abkhaz are fighting to break free from Georgia. Estonian village between the mountains has become empty, almost everyone has returned to their homeland, only 2 men have stayed: Ivo and Margus. But Margus will leave as soon as he has harvested his crops of tangerines. In a bloody conflict in their miniature village wounded men are left behind, and Ivo is forced to take them in. But they are from opposite sides of the war. This is touching anti-war story about Estonians who find themselves in the middle of someone else's war. How do they handle it? How do the enemies act under third-party roof?\nWritten by\nAnnts	https://m.media-amazon.com/images/M/MV5BMTgwNzA3MDQzOV5BMl5BanBnXkFtZTgwNTE5MDE5NDE@._V1_FMjpg_UX1000_.jpg		https://imdb-video.media-imdb.com/vi2747316761/1434659607842-pgv4ql-1564427991577.mp4?Expires=1619437972&Signature=Avkl~mCMWwD8bwD2LveVOrYh4M6uSWhsH-T0wbwKP3W1P~N6OQ6btuazYm8JC0r2f0Fe1Q~U9cI~LN1wmEDsZ2ET4r6Ntrte7WjrSQfiCUqnYRPBIx4Xwzl3K7rw-zKFz-7jHW5lg80gbo8xnBQbbGrQsR2Ew-q-dvVtoBwwqusPn7NI8SpeZIpWkpb1ZNo4Xak5Uccsv4x-u98p0clSpmaxUrLHsS8PdsQMlqpJF5PCBpq-NUdR5DnEwSxc2HWezoIZnwLbCBLQ6PQKePtAKVm~Nl8LYX15d6kHOHQNDVZSEAg6nXFhS6I6bvQaQB0QaH9UwG195cBR3o1yySlfwA__&Key-Pair-Id=APKAIFLZBVQZ24NQH3KA	17 October 2013 (Georgia)			8.2 based on 42,110 user ratings	1h 27min	Estonian\n|\nRussian\n|\nGeorgian	Allfilm, Georgian Film 
